import React from "react";

class User extends React.Component {
    render() {
        return(
            <div className="user" key={user.id}>
                    <h3>{user.firstname} {user.lastname}</h3>
                    <p>{user.placeOfWork}</p>
                    <b>{user.isRich === true ? "Rich :)" : "Poor :("}</b>
            </div>
        )
    }
}

export default User
